onClick:
{{
    (function () {
    storeValue('token', otp_input.text, false);
    LoginVerifyAPI.run(() => {
        console.log('LoginVerifyAPI', LoginVerifyAPI.data);
        var accessKey = LoginVerifyAPI.data['access_key'];
        var secretKey = LoginVerifyAPI.data['secret_key'];
        storeValue('accessKey', accessKey);
        storeValue('secretKey', secretKey);
        var tonce = Date.now().toString();
        UserInfoAPI.run(() => {
            var data = UserInfoAPI.data;
            storeValue('userInfo', data, false);
            navigateTo('Admin Access');
        }, (e) => {
            showAlert(e.message, 'error');
            navigateTo('LoginPage');
        }, {
            'tonce': tonce,
            'accessKey': accessKey,
            'secretKey': secretKey,
            'api': '/wazirx-falcon/api/v1.0/members/me'
        });
    }, (e) => {
        showAlert(e.message, 'error');
    });
    resetWidget('otp_input');
    closeModal('TFA_Modal');
})()
}}
